package com.alex.blog.model;import com.alex.blog.base.BaseModel;import java.util.Date;/** * 文章标签管理表 Model * * @author alex * @date 2019-09-09 22:24:02 */public class BlogTag extends BaseModel {		/** 	* 自增id	*/	private Integer id;	/** 	* 标签名称	*/	private String tagName;	/** 	* 标签code	*/	private String tagCode;	/** 	* 分类排序，数字越大越在前	*/	private Integer orderSort;	/** 	* 创建时间	*/	private Date createTime;	/** 	* 更新时间	*/	private Date updateTime;		public Integer getId() {	    return this.id;	}	public void setId(Integer id) {	    this.id=id;	}	public String getTagName() {	    return this.tagName;	}	public void setTagName(String tagName) {	    this.tagName=tagName;	}	public String getTagCode() {	    return this.tagCode;	}	public void setTagCode(String tagCode) {	    this.tagCode=tagCode;	}	public Integer getOrderSort() {	    return this.orderSort;	}	public void setOrderSort(Integer orderSort) {	    this.orderSort=orderSort;	}	public Date getCreateTime() {	    return this.createTime;	}	public void setCreateTime(Date createTime) {	    this.createTime=createTime;	}	public Date getUpdateTime() {	    return this.updateTime;	}	public void setUpdateTime(Date updateTime) {	    this.updateTime=updateTime;	}}